function generatePdf() {
	doc = new jsPDF();
	
	doc.addImage(page_one, 'JPEG', 0, 0, 205, 300);
	
	//doc.setFont('courier);
	doc.setTextColor(0, 0, 255);
	doc.setFontSize(13);
	
	textOut(90, 201, 'preparedFor_company');
	textOut(90, 206, 'preparedFor_address');
	//textOut(90, 211, 'preparedFor_city');
	doc.text(90, 211, document.getElementById('preparedFor_city').value
		+ ', ' + document.getElementById('preparedFor_state').value
		+ ' ' + document.getElementById('preparedFor_zip').value);
	
	textOut(128, 252, 'preparedBy_name');
	textOut(128, 257, 'preparedBy_email');
	textOut(128, 262, 'preparedBy_phone');
	
	doc.save('arva_test.pdf');
}

function textOut(x, y, divName) {
	doc.text(x, y, document.getElementById(divName).value);
}



